// TestMagicSquare1 calls LargestMagicSquare
func TestMagicSquare1(t *testing.T) {
	s := "[[7,1,4,5,6],[2,5,1,6,4],[1,5,4,3,2],[1,2,7,3,4]]"

	got := LargestMagicSquare(utils.IntMatrix(s))
	want := 3

	if got != want {
		t.Errorf("got %d, wanted %d", got, want)
	}
}

